def transform(sequence):
    result = []
    for i in range(len(sequence)):
        if sequence[i] == '0':
            result.append('0')
        elif sequence[i] != '0' and i < len(sequence) - 1 and sequence[i + 1] == '0':
            result.append(sequence[i])
        else:
            result.append(sequence[i])
            for j in range(i + 1, len(sequence)):
                if sequence[j] == '0':
                    break
                else:
                    result.append(sequence[i])
    return ''.join(result)
